        ee.setText(ee.getControl("panel5"),"修改") 
        ee.setEditText(ee.getControl("edit3"), tmin)   
        ee.setEditText(ee.getControl("edit5"), tmax)
        ee.getControl("edit3")._input.readOnly = true;
        ee.getControl("edit5")._input.readOnly = true;
        return;
    }
    ee.setText(ee.getControl("panel5"),"修改") 
    ee.getControl("edit3")._input.readOnly = true;
    ee.getControl("edit5")._input.readOnly = true;   
    addnewT();
}

