var token = eio.readString8();
var searchText = "";
var pageSize = eio.readInt32();
var pageCurrent = eio.readInt32();
var check1 = eio.readInt32();
var check2 = eio.readInt32();
var sql,sqlResult;
sql = "exec getUserInfoBySession '" + db.encode(token) + "'";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
db.read(sqlResult);
if (db.getString(sqlResult, "sessionId").length < 5) {
    eio.appendString8("F");
    eio.appendString8("token失效");
    es.logWarning("用户token失效, sql=" + sql);
    return;
}   
var userId = db.getString(sqlResult, "id");
var companyId = db.getString(sqlResult, "companyId");

 //获取记录数量
var condition = "";
if (searchText != "") {
    condition +=
        " and (" +
        "(cast(a.id as varchar(15)) like '%" + db.encode(searchText) + "%') or " +
        "(a.[codeEpc] like '%" + db.encode(searchText) + "%') or " +
        "(a.[codeQr] like '%" + db.encode(searchText) + "%') or " +
        "(a.[codeBar] like '%" + db.encode(searchText) + "%')) ";
}
var checkstate="12";                                   
if(check1==1&amp;&amp;check2==1){
     checkstate="0,1";
} 
else if(check1==0&amp;&amp;check2==1){
      checkstate="0";
} 
else if(check1==1&amp;&amp;check2==0){
       checkstate="1";
}

sql= "SELECT [codeEpc],[temperature],CONVERT(varchar(19), regDatetime, 20) regDatetime,[address],'罗一腾' as name,'13812121289' as phone,(case when state=1 then '<span style=''color:red;''>未处理<span>' else '已处理' end) as state,id FROM [rfid].[dbo].[logTemperature] where state in ("+checkstate+") and codeEpc like '%"+condition+"%' and ([temperature]>(SELECT top 1 tmax FROM [rfid].[dbo].[temperature]  order by regDatetime desc) or [temperature]<(SELECT top 1 tmin FROM [rfid].[dbo].[temperature]  order by regDatetime desc))  order by regDatetime desc"
var sqlResultTemperature = db.executeQuery("DB", sql); 
if (sqlResultTemperature == null) {
    eio.appendString8("F");
    eio.appendString8("数据库执行错误");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}    
sql= "SELECT count(*) c FROM [rfid].[dbo].[logTemperature] where state in ("+checkstate+") and codeEpc like '%"+condition+"%' and ([temperature]>(SELECT top 1 tmax FROM [rfid].[dbo].[temperature]  order by regDatetime desc) or [temperature]<(SELECT top 1 tmin FROM [rfid].[dbo].[temperature]  order by regDatetime desc))"

var  sqlResult1 = db.executeQuery("DB", sql);   
db.read(sqlResult1);
var count1 = db.getInt32(sqlResult1, "c"); 

sql="SELECT top 1 id,tmin,tmax,regDatetime  FROM [rfid].[dbo].[temperature]  order by regDatetime desc"
var  sqlResult2 = db.executeQuery("DB", sql);
db.read(sqlResult2);
g5.tmax = db.getString(sqlResult2, "tmax"); 
g5.tmin = db.getString(sqlResult2, "tmin");  
eio.appendString8("T"); 
//eio.appendString8(g5.tmax);
//eio.appendString8(g5.tmin);  
eio.appendString8(g5.tmax);  
eio.appendString8(g5.tmin);
eio.appendInt32(count1);  

eio.appendDataSet(sqlResultTemperature,"codeEpc,temperature,regDatetime,address,name,phone,state,id", pageSize*(pageCurrent-1), pageSize);

